import React from 'react'
import {Route, Switch, BrowserRouter as Router} from 'react-dom'
import Sidebar from './Components/Sidebar/Sidebar'

function App() {
  return (
    <div className="App">
        <Sidebar />
        <Switch>
          <Route path='/player-overview' />
          <Route path='/team-overview'  />
          <Route path='/'/>
          <Route component={() => 404} />
        </Switch>
    </div>
  );
}

export default App;
